Concursante (2007)

Ignored by the mainstream medias and quickly retired by the spanish theaters.

&quot;The Contestant&quot; recounts the roller coaster ride of Martin Circo, the lucky winner of the most lucrative game-show prize in television history to the tune of 3 Million Euros. In this biting satire on consumer society, Martin's stroke of luck sees his life turned upside down. Sometimes, one piece of good luck can ruin your life.

It's a shocking movie about the present monetary system, the banks and the creation of money through debt. A must see!

Language: Spanish
Subtitles: English (SRT)

